(function(doc, win) {
	if (!win.$) {
		console.log('Jquery not found.');
		return;
	}
	var template = 
`
<div class="side-nav-con" style="position: fixed;top: 80px;left: 0;display: none;">
	<a target="_blank" style="display: block;" href="http://baidu.com">
		<img style="display: block;" src="data:image/jpeg;base64,"/>
	</a>
	<span class="hidesome" style="position: absolute;right: 0;bottom: 0;font-size: 14px;color: #333;background-color: #ffda00;padding: 0 3px;line-height: 22px;cursor: pointer;">隐藏</span>
</div>
`;
	$('body').append(template);
	$(doc).on('scroll', function() {
		if ($(doc).scrollTop() > 944) {
			$('.side-nav-con').fadeIn();
		} else {
			$('.side-nav-con').fadeOut();
		}
	})
	$('.side-nav-con .hidesome').on('click', function() {
		$('.side-nav-con').animate({
			left: '-100%'
		})
	})
})(document, this)